import React from "react";
import { StyleSheet, Text, View, Button, Image } from 'react-native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
/*import Button from 'react-native-button';*/


import Home from '../Home';
import Feed from "../Feed";
import Bookings from '../Bookings';
import Favorites from '../Favorites';

const Stack = createNativeStackNavigator(MyStack);

const MyStack = () => {
    return (
    <Stack.Navigator>
        <Stack.Screen name="Feed" component={Feed} />
        <Stack.Screen name="Bookings" component={Bookings} />
        <Stack.Screen name="Favorites" component={Favorites} />
    </Stack.Navigator>
    );
};


const styles = StyleSheet.create({
    mainContainer: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center'
    },
    mainView: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center',
        backgroundColor: "#4545d9",
        marginBottom: 20,
        height: '45%',
    },
    buttonView: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center',
        borderColor: 'transparent',
        position: 'absolute',
        backgroundColor: 'white',
        borderRadius: 20,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 10,
        },
        shadowOpacity: 0.35,
        shadowRadius: 13.00,
        elevation: 8,
        padding: 20,
        borderWidth: 1,
        width: '85%'
    },
    title: {
        textAlign: 'center',
        marginTop: 20,
        marginBottom: 10,
        fontSize: 40,
        fontWeight: 'bold',
        color: '#4545d9'
    },
    subtitle: {
        textAlign: 'center',
        marginTop: 10,
        marginBottom: 35,
        fontSize: 20,
    },
    button: {
        backgroundColor: '#4545d9',
        color: 'white',
        padding: 10,
        borderRadius: 10,
        margin: 5,
        fontSize: 17
    }

});


const StartUp = ({ navigation }) => {
    console.log(navigation);    
    return (
        <MyStack>
        <View style={{height: '100%'}}>
            <View style={styles.mainView }>
                <Image source={require('../../assets/icons/main_icon.png')} style={{width: 150, height: 100, bottom: 40, transform:[{rotate: '40deg'}]}} />
            </View>

        <View style={styles.mainContainer}>
            <View style={styles.buttonView}>
                <Text style={styles.title}>GymBooking</Text>
                <Text style={styles.subtitle}>Supérate día a día</Text>
                {/*<Button style={styles.button} onPrees={() => navigation.navigate('Feed')}>Iniciar Sesión</Button>
                <Button /*style={styles.button}>Registrarse</Button>*/}
                <Button onPrees={() => navigation.navigate('Home')} title='Iniciar Sesión' />
            </View>
        </View>
        </View>
        </MyStack>
    );
};

export default StartUp;
